import React from 'react';
import './FaceImage.css';

const FaceImage = ({url, box})=>{
    console.log(box)
    return(
        <div className='dectectedImg'>
            <img alt='' id='faceDetector' src={url} />
            {box.map(bluebox=>
                <div className='bounding_box' style={{left: bluebox.left, top: box.top, right: box.right, bottom: box.bottom}}></div>
                )
            }
        </div>
    )
}

export default FaceImage;
